@stevenkotler is a NTY bestselling author, Pulitzer Prize nominee, and the Executive Director of the Flow Research Collective. Steven is an expert on flow states and the psychology of human performance. He’s the author of books like Stealing Fire, The Art of the Impossible, and his latest, Gnar Country.

In this mind meld, we riff about the power of the mind, why aging is not just physical, but highly mental, how to stay younger longer, the art and science of flow states, and why Steven chose to risk life and limb by putting his methods to the test for his new book, Gnar Country.

@chrispalmermd enters the mind meld to share mind-blowing revelations about the hidden relationship between mind and metabolism.
Dr. Chris Palmer is a Psychiatrist and Assistant Professor at Harvard Medical School. He’s the author of Brain Energy, A Revolutionary Breakthrough in Understanding Mental Health—and Improving Treatment for Anxiety, Depression, OCD, PTSD, and More.
In this one, Chris shares his personal experience grappling with mental and physical health issues and how he overcame them. We also riff on the importance of questioning and pushing beyond the standard medical dogma and a number of practical dietary and behavioral interventions for both healing and optimal mental and physical health.
